"note": "<div>\n<i class=\"NoteType\">\nPlace Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong></strong><span style=\"font-size:11px;\"><strong>Railway Hotel</strong></span><span style=\"font-size:11px;\">, Herne Bay, Kent. Forming corner of block on High Street./Station Road with Victorian ground floor extension of 1867, over former garden.</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">This pub was renamed </span><strong><span style=\"font-size:11px;\"></span></strong><a href=\"https://www.fourfathoms.co.uk/\"><strong><span style=\"font-size:11px;\">Four Fathoms</span></strong></a><a href=\"https://www.fourfathoms.co.uk/\"><strong></strong></a><span style=\"font-size:10px;\"><a href=\"https://www.fourfathoms.co.uk/\"><strong> - web link</strong></a></span><a href=\"https://www.fourfathoms.co.uk/\"><strong></strong></a><strong></strong><span style=\"font-size:11px;\"><strong> </strong></span><span style=\"font-size:11px;\"> in 1975. **</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">The</span><strong><span style=\"font-size:11px;\"> </span></strong><a href=\"https://goo.gl/maps/rFrQt5fo5M7v6iJr8\"><strong><span style=\"font-size:11px;\">Four Fathoms</span></strong></a><a href=\"https://goo.gl/maps/rFrQt5fo5M7v6iJr8\"><span style=\"font-size:11px;\"> - </span></a><a href=\"https://goo.gl/maps/rFrQt5fo5M7v6iJr8\"></a><span style=\"font-size:10px;\"><a href=\"https://goo.gl/maps/rFrQt5fo5M7v6iJr8\">google maps link</a></span><span style=\"font-size:10px;\"></span><span style=\"font-size:11px;\"> in Herne Bay was named </span><strong><span style=\"font-size:11px;\">Pub of the Year</span></strong><span style=\"font-size:11px;\"> at the Kent Life Food and Drink Awards on Monday, 15th October 2018. Quoted from </span><a href=\"https://www.shepherdneame.co.uk/pubs/herne-bays-four-fathoms-named-pub-year\"><span style=\"font-size:11px;\">Shepherd Neame website</span></a><span style=\"font-size:11px;\"></span>\n</p>\n<p>\n<span style=\"font-size:11px;\"></span><strong><span style=\"font-size:11px;\"></span></strong><span style=\"color:#8f5902;\"><strong><span style=\"font-size:11px;\">Following the death of Alice Jones (nee Robinson), The Railway hotel is where her children  Dulcie and Vera Jones resided with their Aunt's, Emmiline Robinson and Laura Quickenden nee Robinson.</span></strong></span><strong><span style=\"font-size:11px;\"></span></strong><span style=\"font-size:11px;\"> (1911 Census For England &amp; Wales) </span>\n</p>\n<p>\n<span style=\"font-size:11px;\">The tenants names can be traced via local directories and include, William Woodward (1872 - 1877) John Holness (1877) HE Turner (1885 - 1886) I</span><strong><span style=\"font-size:11px;\"></span></strong><em><strong><span style=\"font-size:11px;\">n 1891 the tenant is shown as R Quickenden and the Quickenden family ran the hotel for a long period -  in 1910 the licensee was Mrs L C Quickeden and she was still there in 1920.</span></strong></em><strong><span style=\"font-size:11px;\"></span></strong><span style=\"font-size:11px;\"> In 1935 the licensee was Mr James David Davies and upon his death in 1954 the licence to the Railway Hotel was taken over by his son-in-law Peter Smoothy.</span>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<span style=\"font-size:11px;\">The following entries are in this format:</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">Year/Publican or other Resident/Relationship to Head and or Occupation/Age/Where Born/Source.</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">1874/William Woodward/../../../Post Office Directory ****</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">1881/Elizabeth Boyce/Hotel Keeper, Widow/53/Poplar, Middlesex/Census ****</span><br />\n<span style=\"font-size:11px;\">1881/Jessie Alice Holmes/Daughter/23/Margate, Kent/Census</span><br />\n<span style=\"font-size:11px;\">1881/Emma Harnett/Cook/18/St Nicholas, Kent/Census</span><br />\n<span style=\"font-size:11px;\">1881/Maria H Button/Housemaid/17/Snape, Suffolk/Census</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">1882/George Farmer/../../../Post Office Directory ****</span>\n</p>\n<p>\n<span style=\"font-size:11px;\"></span><strong><span style=\"font-size:11px;\">1913/Mrs Laura C Quickendon</span></strong><span style=\"font-size:11px;\">/../../../Kelly\u2019s Directory **</span>\n</p>\n<p>\n<span style=\"font-size:11px;\"></span><strong><span style=\"font-size:11px;\">1917/Mrs L C Quickendon</span></strong><span style=\"font-size:11px;\">/../../../Canterbury \u201cBlue Book\u201d 1917-18 **</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">1930/Hy Edward Gladden/Proprietor/../../Kelly\u2019s Directory **</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">1938/Jas David Davies/Proprietor/../../Kelly\u2019s Directory **</span>\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n<span style=\"font-size:11px;\">** Provided By Stephen Harris</span>\n</p>\n<p>\n<span style=\"font-size:11px;\">**** Provided By Kevan</span>\n</p>\n</div>\n</div>",
